import React from "react";

import { makeStyles } from "@material-ui/core/styles";
import { Typography, Card, CardContent } from "@material-ui/core";
const useStyles = makeStyles(theme => ({
  test: {
    position: "relative",
    marginLeft: "auto",
    marginRight: "auto",
    width: "100%",
    height: "100%"
  },
  title: {
    flexGrow: 1
  },
  loginCard: {
    justifyContent: "center",
    alignItems: "center",
    display: "flex",
    boxShadow: "0 3px 6px rgba(0,0,0,0.19), 0 10px 15px rgba(0,0,0,0.23)",
    minWidth: "300px",
    margin: "10px auto",
    padding: "8%",
    zIndex: 1
  }
}));
function About() {
  const classes = useStyles();
  return (
    <div className={classes.test}>
      <Card className={classes.loginCard}>
        <CardContent>
          <Typography
            className={classes.title}
            variant="h3"
            color="textPrimary"
          >
            이름 : 양정훈
          </Typography>
          <Typography
            variant="button"
            style={{ margin: "10px", marginLeft: 0, display: "block" }}
          >
            Category: {categorynames[contents.categoryId]}
          </Typography>
          <Typography
            className={classes.textField}
            variant="body1"
            label="Post"
          >
            {contents.contents}
          </Typography>
          {/* <Button className={classes.otherButton}>Prev Article</Button>
        <Button className={classes.otherButton}>Next Article</Button> */}
        </CardContent>
      </Card>
    </div>
  );
}

export default About;
